using System.Reflection;
using Library.Contracts.Database;
using Library.Domain;
using Library.Domain.Database;
using Library.Domain.Queries;
using Microsoft.EntityFrameworkCore;
using Microsoft.Extensions.DependencyInjection;
using Serilog;

var builder = WebApplication.CreateBuilder(args);

builder.Host.UseSerilog((ctx, lc) =>
{
    lc.ReadFrom.Configuration(builder.Configuration);
});

// Add services to the container.

builder.Services.AddControllers();
// Learn more about configuring Swagger/OpenAPI at https://aka.ms/aspnetcore/swashbuckle
builder.Services.AddEndpointsApiExplorer();
builder.Services.AddSwaggerGen();


//db
builder.Services.AddHealthChecks();
// builder.Services.AddDbContext<LibraryDbContext>(o => o.UseInMemoryDatabase("LibraryDb"));
// builder.Services.AddMediatR(o => o.RegisterServicesFromAssemblies(typeof(LibraryQuery).Assembly));
builder.Services.AddDomainServices();

static void AddCustomerData(WebApplication app)
{
    var scope = app.Services.CreateScope();
    var db = scope.ServiceProvider.GetService<LibraryDbContext>();

    //modelBuilder.Entity<Blog>().HasData(new Blog { BlogId = 1, Url = "http://sample.com" });

    var book1 = new Book
    {
        Title = "Harry Potter and the Philosopher's Stone",
        Cover = "",
        Content = "It is a story about Harry Potter, an orphan brought up by his aunt and uncle because his parents were killed when he was a baby. Harry is unloved by his uncle and aunt but everything changes when he is invited to join Hogwarts School of Witchcraft and Wizardry and he finds out he's a wizard.",
        Author = "J. K. Rowling",
        Genre = "Fantasy"
    };
    var book2 = new Book
    {
        Title = "Harry Potter and the Chamber of Secrets",
        Cover = Guid.NewGuid().ToString(),
        Content = "Historical Context of Harry Potter and the Chamber of Secrets. Harry Potter and the Chamber of Secrets is the first of the books to touch on the harmful prejudice rampant in the wizarding world, which eventually allows the dark wizard Voldemort to return to power.",
        Author = "J. K. Rowling",
        Genre = "Fantasy"
    };
    var book3 = new Book
    {
        Title = "Harry Potter and the Prisoner of Azkaban",
        Cover = Guid.NewGuid().ToString(),
        Content = "Harry Potter and the Prisoner of Azkaban is a fantasy novel written by British author J. K. Rowling and is the third in the Harry Potter series. The book follows Harry Potter, a young wizard, in his third year at Hogwarts School of Witchcraft and Wizardry. Along with friends Ronald Weasley and Hermione Granger, Harry investigates Sirius Black, an escaped prisoner from Azkaban, the wizard prison, believed to be one of Lord Voldemort's old allies.",
        Author = "J. K. Rowling",
        Genre = "Fantasy"
    };
    var book4 = new Book
    {
        Title = "Harry Potter and the Goblet of Fire",
        Cover = Guid.NewGuid().ToString(),
        Content = "Harry Potter and the Goblet of Fire is a fantasy novel written by British author J. K. Rowling and the fourth novel in the Harry Potter series. It follows Harry Potter, a wizard in his fourth year at Hogwarts School of Witchcraft and Wizardry, and the mystery surrounding the entry of Harry's name into the Triwizard Tournament, in which he is forced to compete.",
        Author = "J. K. Rowling",
        Genre = "Fantasy"
    };

    Random r = new Random();
    List<Rating> ratingList = new List<Rating>();
    List<Review> reviewList = new List<Review>();

    for (int i = 0; i < 70; i++)
    {
        var rating = new Rating
        {
            BookID = r.Next(1,5),
            Score = r.Next(1,6)
        };
        ratingList.Add(rating);
    }

    for (int i = 0; i < 70; i++)
    {
        var review = new Review
        {
            BookID = r.Next(1,5),
            Message = $"message{i}",
            Reviewer = $"reviewer{i}"
        };
        reviewList.Add(review);
    }


    db.Books.Add(book1);
    db.Books.Add(book2);
    db.Books.Add(book3);
    db.Books.Add(book4);

    db.Ratings.AddRange(ratingList);
    db.Reviews.AddRange(reviewList);

    db.SaveChanges();
}

var app = builder.Build();
AddCustomerData(app);


// Configure the HTTP request pipeline.
if (app.Environment.IsDevelopment())
{
    app.UseSwagger();
    app.UseSwaggerUI();
}

app.UseHttpsRedirection();

app.UseCors(policy => policy.AllowAnyHeader().AllowAnyMethod().AllowAnyOrigin());

app.UseAuthorization();

app.MapControllers();
app.MapHealthChecks("/health");

app.Run();
